CREATE FUNCTION public.refresh_reports() RETURNS void
    LANGUAGE plpgsql
    AS $$
BEGIN
  TRUNCATE public.report_shift_expenses, public.report_shift_materials, public.report_shift_crew;

    shift_id, shift_date, brigadier_full_name, ship_name, holds_count,
    food_amount, materials_amount, taxi_amount, other_amount, other_comment, total_expenses, updated_at
  )
  SELECT
    s.id,
    s.date,
    (b.last_name || ' ' || b.first_name) AS brigadier_full_name,
    sh.name AS ship_name,
    s.holds_count,
    COALESCE(e.food_amount, 0),
    COALESCE(e.materials_amount, COALESCE(e.transport_amount, 0)), -- fallback на старое поле
    COALESCE(e.taxi_amount, 0),
    COALESCE(e.other_amount, COALESCE(e.total_expenses, 0)),       -- fallback на старое поле
    e.other_comment,
    ( COALESCE(e.food_amount,0)
    + COALESCE(e.materials_amount, COALESCE(e.transport_amount,0))
    + COALESCE(e.taxi_amount,0)
    + COALESCE(e.other_amount, COALESCE(e.total_expenses,0))
    ) AS total_expenses,
    now()
  FROM public.shifts s
  JOIN public.brigadiers b ON b.id = s.brigadier_id
  JOIN public.ships sh     ON sh.id = s.ship_id
  LEFT JOIN public.shift_expenses e ON e.shift_id = s.id;

    shift_id, shift_date, brigadier_full_name, ship_name, holds_count,
    pvd_3m_used, pvd_3m_in, pvd_3m_balance,
    pvd_6m_used, pvd_6m_in, pvd_6m_balance,
    pvd_12m_used, pvd_12m_in, pvd_12m_balance,
    pvd_14m_used, pvd_14m_in, pvd_14m_balance,
    pvh_tubes_used, pvh_tubes_in, pvh_tubes_balance,
    tape_used, tape_in, tape_balance,
    photo_report_url, updated_at
  )
  SELECT
    s.id,
    s.date,
    (b.last_name || ' ' || b.first_name),
    sh.name,
    s.holds_count,

    COALESCE(SUM(m.pvd_3m_used),0),
    COALESCE(SUM(m.pvd_3m_in),0),
    COALESCE(SUM(m.pvd_3m_balance),0),

    COALESCE(SUM(m.pvd_6m_used),0),
    COALESCE(SUM(m.pvd_6m_in),0),
    COALESCE(SUM(m.pvd_6m_balance),0),

    COALESCE(SUM(m.pvd_12m_used),0),
    COALESCE(SUM(m.pvd_12m_in),0),
    COALESCE(SUM(m.pvd_12m_balance),0),

    COALESCE(SUM(m.pvd_14m_used),0),
    COALESCE(SUM(m.pvd_14m_in),0),
    COALESCE(SUM(m.pvd_14m_balance),0),

    COALESCE(SUM(m.pvh_tubes_used),0),
    COALESCE(SUM(m.pvh_tubes_in),0),
    COALESCE(SUM(m.pvh_tubes_balance),0),

    COALESCE(SUM(m.tape_used),0),
    COALESCE(SUM(m.tape_in),0),
    COALESCE(SUM(m.tape_balance),0),

    s.photo_report_url,
    now()
  FROM public.shifts s
  JOIN public.brigadiers b ON b.id = s.brigadier_id
  JOIN public.ships sh     ON sh.id = s.ship_id
  LEFT JOIN public.shift_materials m ON m.shift_id = s.id
  GROUP BY s.id, s.date, b.last_name, b.first_name, sh.name, s.holds_count, s.photo_report_url;

    shift_id, shift_date, brigadier_full_name, ship_name, holds_count,
    driver_full_name, deputy_full_name, workers_list, updated_at
  )
  SELECT
    s.id,
    s.date,
    (b.last_name || ' ' || b.first_name),
    sh.name,
    s.holds_count,
    d.full_name,
    COALESCE(dep.full_name, '—'),
    COALESCE(string_agg(w.full_name, ', ' ORDER BY w.full_name) FILTER (WHERE w.full_name IS NOT NULL), ''),
    now()
  FROM public.shifts s
  JOIN public.brigadiers b   ON b.id = s.brigadier_id
  JOIN public.ships sh       ON sh.id = s.ship_id
  LEFT JOIN public.shift_crew sc ON sc.shift_id = s.id
  LEFT JOIN public.drivers d     ON d.id = sc.driver_id
  LEFT JOIN public.workers dep   ON dep.id = sc.deputy_worker_id
  LEFT JOIN public.shift_workers sw ON sw.shift_id = s.id
  LEFT JOIN public.workers w        ON w.id = sw.worker_id
  GROUP BY s.id, s.date, b.last_name, b.first_name, sh.name, s.holds_count, d.full_name, dep.full_name;

END;
$$;


